function CakeContainer() {
    return (
        <div>
            <h2>Number of Cakes</h2>
            <button>buy cake</button>
        </div>
    )
}

const mapStateToProps = state => {
    return {
        numOfCakes: state.numOf
    }
}

export default  CakeContainer;
